- input: "TEXT\x1CC00412569\x1C.TEXT\x1C\x1CF3XA\x1CAll salary expense reported on
    line 21(b) is supposed to be reported on line 30(b). However, FEC software version
    6.2.1.0 does not allow this.  Neither does Version 6.3.1.1.     AUDIT RESPONSE:
    \ 1. Procedures to collect money: All advertising and invitations ask for name,
    address, phone #, e-mail address, occupation and employer name. However, some
    people just send a check. We follow up immediately with a thank you note. The
    note is accompanied with a written request for any missing information.  2. 100%
    Federal fund raising expenditures were reallocated from line 21(a) to line 21(b).
    Schedule H2 has been deleted. 3. 100% Federal administrative expenditures were
    reallocated from line 21(a) to line  21(b).  \n"
